import { lookup } from '../lookup'

export function createTweet(newTweet, callback) {
    lookup("POST", "tweet/create/", callback, { content: newTweet });
  }
  
  
  export function loadTweets(callback) {
    lookup("GET", "tweet/", callback);
  }
